import React, { Component } from 'react';


class Card extends Component{

  render(){
    return(
      <div className="boxes">
        <a className="box" href="">
          <img className="box_thumbnail" src =''></img>
          <div className="separate">
            <div className="box_left">
              <img src='' className="box-icon"></img>
            </div>
            <div className="box_right">
              <div className="box_right_title">タイトル</div>
              <div className="box_right_username">名前</div>
              <div className="box_right-view">支援 0 回/公開日</div>
            </div> 
         </div>
        </a>  
      </div>
    );
  }
}

export default Card;
